import React from 'react';
import style from '../FormButton/FormButton.module.scss'

class FormButton extends React.Component{
  render() {
    const {btnText,btnClass } = this.props;

    let btnClass2 ='';

    if(btnClass === 'btn_pink') {
	   btnClass2 = style.btn_pink
	}

    return (
	  btnText ? <button className={`${style.btn} ${btnClass2}`}>{btnText}</button> : ''
	)
  }
}
export default FormButton;
